// --- Hook getaddrinfo ---
int (*orig_getaddrinfo)(const char*, const char*, const struct addrinfo*, struct addrinfo**) = NULL;

int getaddrinfo(const char *node, const char *service,
                const struct addrinfo *hints, struct addrinfo **res) {
    if (!orig_getaddrinfo) orig_getaddrinfo = dlsym(RTLD_NEXT, "getaddrinfo");

    if (antibanOn && node) {
        for (int i=0; banned_domains[i]; i++) {
            if (strstr(node, banned_domains[i])) {
                NSLog(@"[antiban] blocked domain: %s", node);
                return EAI_NONAME; // Không resolve được
            }
        }
    }
    return orig_getaddrinfo(node, service, hints, res);
}

// --- Tạo nút toggle ---
__attribute__((constructor))
static void init_antiban_button() {
    dispatch_async(dispatch_get_main_queue(), ^{
        UIWindow *keyWindow = [UIApplication sharedApplication].keyWindow;
        if (!keyWindow) return;

        UIButton *btn = [UIButton buttonWithType:UIButtonTypeCustom];
        btn.frame = CGRectMake(50, 150, 100, 40);
        btn.backgroundColor = [[UIColor blackColor] colorWithAlphaComponent:0.3];
        [btn setTitle:@"antiban" forState:UIControlStateNormal];
        btn.titleLabel.font = [UIFont boldSystemFontOfSize:14];
        btn.layer.cornerRadius = 8;

        [btn addTarget:[^{
            antibanOn = !antibanOn;
            NSString *status = antibanOn ? @"ON" : @"OFF";
            NSLog(@"[antiban] toggled -> %@", status);
            [btn setTitle:[NSString stringWithFormat:@"antiban %@", status] forState:UIControlStateNormal];
        } copy] action:@selector(invoke) forControlEvents:UIControlEventTouchUpInside];

        [keyWindow addSubview:btn];
    });
}